Rules.InvariantScript:
With(
    {
        Key: Trim(txtKeyInput_Mapper.Text),
        Value: Trim(txtValueInput_Mapper.Text)
    },
    If(
        !IsBlank(Key) && !IsBlank(Value),
        Collect(
            Items,
            Patch(
                Mapper.ProcessUserInput(ThisRecord),
                {Id: GUID()}
            )
        )
    )
);
Reset(txtKeyInput_Mapper);
Reset(txtValueInput_Mapper);
SetFocus(txtKeyInput_Mapper)

ControlPropertyState.AutoRuleBindingString:
{
    Key:{
        Label: "Key",
        Tooltip: "Enter a key",
        Placeholder: "---",
        MaxLength: 200,
        Format: TextFormat.Text
    },
    Value:{
        Label: "Value",
        Tooltip: "Enter a value",
        Placeholder: "---",
        MaxLength: 200,
        Format: TextFormat.Text
    }
}

Rules.InvariantScript:
ForAll(
    Items,
    {
        Key: Key,
        Value: Value
    }
)

{
    Key: {
        Label: "Key",
        Tooltip: "Enter a key",
        Placeholder: "---",
        MaxLength: 200,
        Format: TextFormat.Text
    },
    Value: {
        Label: "Value",
        Tooltip: "Enter a value",
        Placeholder: "---",
        MaxLength: 200,
        Format: TextFormat.Text
    }
}

Clear(Items);
ForAll(
    Mapper.Items,
    Collect(
        Items,
        {
            Id: GUID(),
            Key: Key,
            Value: Value
        }
    )
)
